using Microsoft.EntityFrameworkCore;
using SGED.Objects.Models.Entities;

namespace SGED.Context.Builders
{
    public class UsuarioBuilder
    {
        public static void Build(ModelBuilder modelBuilder)
        {
            // Builder
            modelBuilder.Entity<Usuario>().HasKey(u => u.Id);
            modelBuilder.Entity<Usuario>().Property(u => u.ImagemPessoa).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.NomePessoa).HasMaxLength(70).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.EmailPessoa).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.SenhaUsuario).HasMaxLength(50).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.TelefonePessoa).HasMaxLength(15).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.CpfCnpjPessoa).HasMaxLength(18).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.RgIePessoa).HasMaxLength(15).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.CargoUsuario).HasMaxLength(50).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.StatusUsuario).IsRequired();
            modelBuilder.Entity<Usuario>().Property(u => u.StatusUsuario).IsRequired();

            // Relacionamento: TipoUsuario -> Usuario
            modelBuilder.Entity<Usuario>()
                .HasOne(u => u.TipoUsuario)
                .WithMany(tu => tu.Usuarios)
                .HasForeignKey(u => u.IdTipoUsuario)
                .OnDelete(DeleteBehavior.Cascade);


            // Inserções
            modelBuilder.Entity<Usuario>().HasData(
                new Usuario { Id = 1, NomePessoa = "SGED", EmailPessoa = "sged@development.com", SenhaUsuario = "123456", TelefonePessoa = "(00) 00000-0000", CpfCnpjPessoa = "000.000.000-00", RgIePessoa = "00.000.000-0", CargoUsuario = "Desenvolvimento", StatusUsuario = true, IdTipoUsuario = 1, ImagemPessoa = "data:image/png;base64," },
                new Usuario { Id = 2, NomePessoa = "Secretário Geral", EmailPessoa = "admin@gmail.com", SenhaUsuario = "987654", TelefonePessoa = "(00) 00000-0000", CpfCnpjPessoa = "000.000.000-00", RgIePessoa = "00.000.000-0", CargoUsuario = "Secretário Geral", StatusUsuario = true, IdTipoUsuario = 2, ImagemPessoa = "data:application/octet-stream;base64," }
            );
        }
    }

}
